function ExerciseContainer({id, name, type, muscle, description}) {
    return ( 
        <div key={id} id="exerciseContainer">
            <p id="exerciseName">{name}</p>
            <p id="exerciseType">{type}</p>
            <p id="exerciseMuscle">{muscle}</p>
            <p id="exerciseDescription">{description}</p>
        </div>
    );
}

export default ExerciseContainer;
